import React from 'react';

const Welcome = () => {
  return (
    <div className="welcome">
      <h1>Добро пожаловать</h1>
      <p>
        Добро пожаловать на наш сайт! Здесь вы можете зарегистрироваться 
        или войти в систему, чтобы получить доступ к дополнительным возможностям.
      </p>
    </div>
  );
};

export default Welcome;
